import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    { title: "Car Insurance", amount: 5349, date: new Date(2022, 0, 26) },
    { title: "Car Insurance", amount: 5349, date: new Date(2022, 0, 26) },
    { title: "Car Insurance", amount: 5349, date: new Date(2022, 0, 26) },
  ];

  return (
    <div>
      <h2>Let's get started here!</h2>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
